import { Route, Routes } from 'react-router-dom';
import './App.css';
import { Word } from './componnent/Word';

import React from 'react';
import Word1 from './componnent/Word1';
import Word2 from './componnent/Word2';


function App() {
  return (
    <div className='App'>
      <Word/>
<Routes>
  <Route path='/word1' element = {<Word1 />} />
  <Route path='/word2' element = {<Word2 />} />
  </Routes>
    </div>
  );
}

export default App;
